import { Canvas, Image, useImage } from "@shopify/react-native-skia";

export const SkiaCanvas = () => {
    const base64 = ``;
    const imageData = `data:image/png;base64,${base64}`;
    const image = useImage(imageData);
    console.log("Render - image is:", image === null ? "null" : "not null");
    return (
      <Canvas style={{ flex: 1}}>
        <Image x={0} y={0} width={100} height={100} image={image} />
      </Canvas>
    );
  };